                    $numComplete++;
                }
                $numTotal++;
            }
            $lvlsPercentComplete[] = $numComplete / $numTotal * 100;
        }

        // Cluster stuff
        $sourceColumns = [];
        $allColumns = [];
        $startLevel = 1;
        $endLevel = 8;
        for ($lvl = intval($startLevel); $lvl <= intval($endLevel); $lvl++) {
            $allColumns = array_merge($allColumns, [
                [array_column_fixed($moveCol, $lvl), 'numMovesPerChallenge', [216], $lvl],
