            $query .= "AND a.session_id IN
            (
                SELECT session_id FROM
                (
                    SELECT * FROM (
                        SELECT session_id, event_custom
                        FROM log
                        WHERE event_custom=1
                        GROUP BY session_id
                        HAVING COUNT(*) >= ?
                    LIMIT ?) temp
                ) AS moves
            ) ";
            $params []= $minMoves;
            $params []= $maxRows;
            $paramTypes .= 'ii';
        }

        if ($minQuestions > 0) {
            $query .= "AND a.session_id IN
